 Sum the gross value of loans to Australian and offshore financial corporations, including
* treasury related short term lending to other banks;
* corporate banking customer relationship lending to other financial institutions;
* placements with other banks;
* loans and advances to other banks;
* loans with banks and non-bank financial institutions;
* nostro balances with banks and non-bank financial institutions; and
* loans and advances to controlled entities and associates.
Exclude:
* certificates of deposit (should be reported as Investment or Trading securities).
This reporting item should be brought to account at the gross value of the outstanding balance. Interest is taken to profit and loss when earned.

Include:
* overdrafts;
* secured and unsecured borrowings;
* financial lease agreements;
* account balances which do not qualify as deposits;
* credit card outstanding balances; and
* term loans.
Exclude:
* bills of exchange, commercial paper and promissory notes (report as Investment or Trading securities);
* bills of exchange both discounted and held; and
* bonds, debentures, MTNs, TCDs, FRNs (show as Investment or Trading securities).
Loans and advances for all levels of Australian government are recognized at amortised cost, after assessing required provisions for impairment.

 Include
* overdrafts;
* secured and unsecured borrowings;
* financial lease agreements;
* account balances which do not qualify as deposits;
* credit card outstanding balances; and
* term loans.
Exclude:
* bills of exchange, commercial paper and promissory notes (there are separate categories for short-term debt securities); * bills of exchange both discounted and held; and
* bonds, debentures, MTNs, TCDs, FRNs (show as long-term debt securities).
Loans and advances are recognized at amortised cost, after assessing required provisions for impairment for all governments (foreign and domestic).

Report the gross value of loans to Private trading corporations which include:
* all resident private corporate trading enterprises;
* intra-group financiers (Financial Sector (Collection of Data) Act 2001 Category I) and parent companies with significant holdings of shares in private trading companies;
* privately owned schools and hospitals;
* any unincorporated unit that is a branch in Australia of a non-resident company and which is not included in the financial sector; and
* any unincorporated business owned and operated by trading corporations (e.g. joint ventures).
Exclude:
* unincorporated businesses, except for branches of non-resident companies and joint ventures or partnerships owned by corporations; and
* non-resident enterprises.                                                                                                                                                                                                                                                In addition report the gross value of loans to Public non-financial corporation which include all trading enterprises, 50% or more owned by the Commonwealth, State, Territory and local government or controlled by the Commonwealth, State, Territory and local government, through legislation, decree or regulation (e.g. Australia Post, and Australian Government Solicitor, state rail and water authorities, gas and fuel authorities, housing commissions, port authorities, non-privatised power authorities).  
Exclude:
* government departments (show as Commonwealth general government);
* government-owned financial institutions (these are classified as financial institutions);
* state government owned financial institutions and entities in the general government; and
* state and territory central borrowing authorities.

Report the gross value of loans to Private trading corporations which include:
* all resident private corporate trading enterprises;
* intra-group financiers (Financial Sector (Collection of Data) Act 2001 Category I) and parent companies with significant holdings of shares in private trading companies;
* privately owned schools and hospitals;
* any unincorporated unit that is a branch in Australia of a non-resident company and which is not included in the financial sector; and
* any unincorporated business owned and operated by trading corporations (e.g. joint ventures).
Exclude:
* unincorporated businesses, except for branches of non-resident companies and joint ventures or partnerships owned by corporations; and
